import React, { useEffect, useState } from "react";
import DBCard from "../../components/ui/DBCard";
import useAuthCheck from "../../hooks/useAuthCheck";
import logo from "../../assets/logo1.png";
const serverUrl = process.env.REACT_APP_SERVER_URL;

function Dashboard({ theme }) {
  useAuthCheck();
  return (
    <div className="w-full h-full flex flex-col flex-grow gap-5">
      <div className="flex w-full rounded-xl h-16 shadow-md bg-fantasy p-4 pl-10 font-bold">
        DASHBOARD
      </div>
      <div className=" flex flex-wrap gap-5 w-full  ">
        <div className="  rounded-xl p-5 shadow-md flex flex-wrap flex-2 flex-col gap-5 w-full max-w-screen-sm max-h-64 bg-fantasy">
          <div className="flex flex-col w-1/2 ">
            <label className="text-xs text-gray-500">Username</label>
            <p className="text-sm font-bold md:text-md">SMOOSH3R</p>
          </div>
          <div className="flex flex-col w-1/2 ">
            <label className="text-xs text-gray-500">Email</label>
            <p className="text-sm font-bold md:text-md">pugadmaharlika@gmail.com</p>
          </div>
          <div className="flex flex-col w-1/2">
            <label className="text-xs  text-gray-500">Perlas</label>
            <p className="text-sm font-bold md:text-md">100,000</p>
          </div>
          <div className="flex flex-col w-1/2">
            <label className="text-xs  text-gray-500">Gold</label>
            <p className="text-sm font-bold md:text-md">100,000</p>
          </div>
        </div>
        <div className="  rounded-xl p-5 shadow-md flex flex-2 flex-col gap-5 w-full max-w-screen-sm bg-fantasy">
          asdas
        </div>
      </div>
      {/* <DBCard /> <DBCard /> <DBCard /> <DBCard /> */}
    </div>
  );
}

export default Dashboard;
